import React from "react";
import FlipCard from '../FlipCard'
import Road from "../Road"
import {Bar, Doughnut, Polar, Radar, HorizontalBar} from 'react-chartjs-2';


function RoadLevel2(props) {

    return(
        <div style = {{display: 'flex', flexDirection: 'column', 
        marginTop:'1.5%'}}>
                <Road 
                      width={'10em'}
                      height={'10em'}
                      StylingInfo = {'horizontal-road2'}
                    />
                      <Road 
                     width={'10em'}
                     height={'5em'}
                     StylingInfo = {'vertical-road'}
                       />
                    <FlipCard
                    width = {"25em"}
                    height = {"24em"}
                    Front=
                    {
                      <div>
                        <h1 className = 'progLang-hF'>
                        {props.plChartData.frontTitle}
                        </h1>
                        <p style= {{position: 'fixed', bottom: -16, right:0, color:'yellow'}}>
                          {props.clickMessage}
                        </p>
                      </div>
                    }
                    Back = {
                      <div>
                        <Doughnut data={props.plChartData}
                          options= {props.plChartData.options}
                        />
                      </div>
                        }
                  >
                  </FlipCard>
                  <Road 
                     width={'10em'}
                     height={'5em'}
                     StylingInfo = {'vertical-road'}
                       />
                  <Road 
                     width={'10em'}
                     height={'10em'}
                     StylingInfo = {'vertical-road1'}
                     paddingRight = {'60%'}
                  />

        </div>


    )


}

export default RoadLevel2
